import img from "../../Assets/error.svg";
import "./ErrorStyles.css";

const Error = () => {
  return (
    <>
      <div className="error-wrap">
        <h1>Hiba! Az oldal nem található</h1>
        <img src={img} alt="error page" />
      </div>
    </>
  );
};

export default Error;
